import React from "react";
import "./Frame36264.css";

function Frame36264(props) {
  const { fruits, className } = props;

  return (
    <div className={`frame-36268 ${className || ""}`}>
      <div className="fruits ibmplexsans-normal-quarter-spanish-white-16px">{fruits}</div>
    </div>
  );
}

export default Frame36264;
